<!doctype html>
<html lang="en">

<head>
	<!-- Required meta tags -->
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title>Notre Histoire - Iqrae</title>
</head>

<body>
								<div class="product-wrapper">
									<div class="product-grid">
										<div class="row row-cols-2 row-cols-md-3 row-cols-lg-4 row-cols-xl-4">
										    
										@foreach ($images as $image)
										    <div>
										        <p style="margin: 0;text-align: center;font-size: 30px;">
										            <strong>Genre</strong>: {{$image->genre}}, 
										            <strong>Couleur pref</strong>: {{$image->color}}, 
										            <strong>info</strong>: {{$image->info}}
										        </p>
										    </div>
											<div class="col">
												<div class="card rounded-0 product-card">
													<img width="100%" src="../../assets/images/liste/{{$image->list}} " class="card-img-top" >
												</div>
											</div>
											@endforeach 
